import React from 'react'
import "./Account.css"
import Navbar from '../components/Header/Navbar'
import profile from "../assets/images/userprofile.png"
import { useNavigate } from 'react-router-dom'
import axios from '../api/axios'

function Account() {

    const [user, setUser]=useState();
    const [recipe, setRecipe]=useState();
    
    const navigate=useNavigate();
    const handleClick=()=>{
        navigate("/login/home/publish");
    }



  return (
    <div className='account-container'>
        <Navbar/>
        <div className='account-user-heading'>
            welcome!
        </div>
        <div className='user-details'>
            <div><img src={profile} alt=''/></div>
            <div><p>card 1</p></div>
        </div>
        <div className='recipe-details'>
            <button> <div className='recipe'><p>recipe 1</p></div> </button>
            <button> <div className='recipe'><p>recipe 2</p></div></button>
            <button> <div className='recipe' onClick={handleClick}><p>+</p></div></button>

        
        </div>
    </div>
  )
}

export default Account
